import '../css/navbar.css'
import { Link } from "react-router-dom";

function Navbar() {
    return (
        <nav
          style={{
            borderBottom: 'solid 1px',
            paddingBottom: '1rem',
          }}
        >
            <Link to="/home">Home</Link>
            <Link to="/users">Users</Link>
        </nav>
    );
}

  export default Navbar;
